import React from 'react';
import { FlatList, Text, View, Image, Dimensions } from 'react-native';

const data = [
  { key: '1', title: 'gojo 1', image: 'data:image/jpeg;base64,' },
  { key: '2', title: 'gojo 2', image: 'data:image/jpeg;base64,' },
  { key: '3', title: 'gojo 3', image: 'data:image/jpeg;base64,' },
  { key: '4', title: 'gojo 4', image: 'data:image/jpeg;base64,' },
  { key: '5', title: 'gojo 5', image: 'data:image/jpeg;base64,' },
  { key: '6', title: 'gojo 6', image: 'data:image/jpeg;base64,' },
  { key: '7', title: 'gojo 7', image: 'data:image/jpeg;base64,' },
  { key: '8', title: 'gojo 8', image: 'data:image/jpeg;base64,' },
 
];

const MyComponent = () => {
  const renderItem = ({ item }) => (
    <View style={{
      flex: 1,
      margin: 10,
      alignItems: 'center',
      backgroundColor: 'chocolate'
    }}>
      <Image
        style={{
          width: (Dimensions.get('window').width / 2) - 30,
          height: 150,
          marginBottom: 10,
          borderWidth: 2,
          borderColor: 'black',
          borderRadius: 10,
        }}
        source={{ uri: item.image }}
      />
      <Text style={{ 
        fontSize: 16, 
        fontWeight: 'bold'
        }}>{item.title}</Text>
    </View>
  );

  return (
    <FlatList
      data={data}
      renderItem={renderItem}
      keyExtractor={item => item.key}
      numColumns={2} 
      contentContainerStyle={{ padding: 10 }}
    />
  );
};

export default MyComponent;

